import React, { useEffect, useState } from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { switchCategory, getCategory } from './categorySlice';

export default function CategoryTabs() {

  const selectedCategory = useSelector((state)=>state)

  const dispatch = useDispatch();

  useEffect(()=>{
    let selectedCategory = dispatch(getCategory);
    console.log(selectedCategory);
  },[])

  console.log("selectedCategory::::", selectedCategory)

  return (
    <div className='d-flex'>
        <div className='cat-btn'>Men</div>
        <div className='cat-btn cat-active'>Women</div>
        <div className='cat-btn'>Kids</div>
        <div className='cat-btn'>Beauty</div>
    </div>
  )
}
